import styled from "styled-components";

function ProductCard({ onNavigate }) {
    return (
        <S.Item onClick={onNavigate}>
            <h4></h4>
            <p>상품번호:</p>
            <p>가격: 원</p>
            <p>사이즈: </p>
            <p>평점: </p>
            <p>리뷰: </p>
        </S.Item>
    );
}
export default ProductCard;

const Item = styled.li`
    border: 1px solid #000;
    cursor: pointer;
    width: 300px;
    margin: 16px auto;
`;

const S = {
    Item,
};
